import React, { useEffect, useState } from 'react';
import axios from '../../axiosConfig';
import './HomePage.css';

const HomePage = () => {
  const [books, setBooks] = useState([]);
  const [selectedBook, setSelectedBook] = useState(null);

  // Fetch books from the backend
  useEffect(() => {
    const fetchBooks = async () => {
      try {
        const response = await axios.get('/books');
        setBooks(response.data); // Assumes books are in response.data
      } catch (error) {
        console.error('Error fetching books:', error);
      }
    };

    fetchBooks();
  }, []);

  // Handle book click to display detailed info
  const handleBookClick = (book) => {
    setSelectedBook(book);
  };

  // Star rendering based on average rating
  const renderStars = (rating) => {
    const fullStars = Math.floor(rating);
    const halfStars = rating % 1 >= 0.5 ? 1 : 0;
    const emptyStars = 5 - fullStars - halfStars;

    return (
      <>
        {'★'.repeat(fullStars)}{'☆'.repeat(emptyStars)}
        {halfStars ? '½' : ''}
      </>
    );
  };

  // Handle review submission
  const handleReviewSubmit = async (bookId, review) => {
    try {
      await axios.post(`/books/${bookId}/reviews`, { review });
      alert('Review submitted successfully!');
    } catch (error) {
      console.error('Error submitting review:', error);
      alert('Failed to submit review. Please try again.');
    }
  };

  return (
    <div className="home-container">
      <h1>Welcome to BookHub</h1>
      <p>Explore our collection of books!</p>

      <div className="books-grid">
        {books.map((book) => (
          <div className="book-card" key={book._id}>
            <img
              src={book.thumbnail}
              alt={book.title}
              className="book-thumbnail"
              onClick={() => handleBookClick(book)} // Clickable thumbnail
            />
            <h3>{book.title}</h3>
            <p>{book.authors.join(', ')}</p>
            <p>{renderStars(book.average_rating)} ({book.average_rating})</p> {/* Star display */}
            <p>Year: {book.published_year}</p>
            <p>{book.categories.join(', ')}</p>

            {/* Review Form */}
            <div className="review-form">
              <h4>Leave a Review</h4>
              <textarea
                rows="3"
                placeholder="Write your review here..."
                onBlur={(e) => (book.reviewText = e.target.value)} // Temporary storage
              />
              <button onClick={() => handleReviewSubmit(book._id, book.reviewText)}>Submit</button>
            </div>
          </div>
        ))}
      </div>

      {/* Selected book details */}
      {selectedBook && (
        <div className="book-details-modal">
          <button onClick={() => setSelectedBook(null)}>Close</button>
          <h2>{selectedBook.title}</h2>
          <p>{selectedBook.subtitle}</p>
          <p>{selectedBook.authors.join(', ')}</p>
          <p>{selectedBook.categories.join(', ')}</p>
          <img src={selectedBook.thumbnail} alt={selectedBook.title} />
          <p>{selectedBook.description}</p>
          <p>Year: {selectedBook.published_year}</p>
          <p>Pages: {selectedBook.num_pages}</p>
          <p>{renderStars(selectedBook.average_rating)} ({selectedBook.average_rating})</p>
        </div>
      )}
    </div>
  );
};

export default HomePage;
